import React from "react";

const Sidebar = (props) => {
  // console.log(props.person)
  // debugger
  return <ul className="sidebar-ul">
    {props.people.map((person => {
        return <SideBar person={person} key={person.id}/>
      }))}}
  </ul>;
};

export default Sidebar;
